import React, { useEffect, useState } from 'react';

const StationsList = () => {

    const [station, setStation] = useState([]);

    useEffect(() => {
        console.log(station);
        obtenerDatos();
    }, [])

    const obtenerDatos = async() => {
        const data = await fetch('https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5237');
        const stations = await data.json();
        setStation(stations.ListaEESSPrecio);
    }

    return (
        <div>
            <h1>Gasolineras</h1>
            <ul>
                {
                    station.map(item => (
                        <li key={item.Latitud}>{item['Rótulo']} {item['Dirección']} Localidad: {item.Localidad} Precio Gasóleo: {item['Precio Gasoleo A']}€ Precio Gasolina 95: {item['Precio Gasolina 95 E5']} </li>
                    ))
                }
            </ul>
        </div>
    );
}

export default StationsList;
